# Number of vehicles
num_vehicles = 30

start = 0
end = 200
step = 200
arr = stri.split(" ")
edges = []
for i in range(num_vehicles):
    edges.append(" ".join(arr[start:end]))
    start += step
    end += step

# Function to create a vehicle element with a random depart value
def create_vehicle_element(vehicle_id, depart, edge):
    vehicle = ET.Element('vehicle')
    vehicle.set('id', str(vehicle_id))
    vehicle.set('depart', str(depart))
    route = ET.SubElement(vehicle, 'route')
    route.set('edges', str(edge))
    return vehicle


# Generate vehicles with progressively increasing random depart values
vehicles = []
starting_id = 100

for i in range(num_vehicles):
    vehicle_id = i + starting_id  # ID starts from 1 and goes up to 500
    depart = "3600.00"
    vehicle_element = create_vehicle_element(vehicle_id, depart, edges[i])
    vehicles.append(vehicle_element)

# Sort vehicles by id and depart (already sorted by id, just a safety measure)
vehicles.sort(key=lambda x: (int(x.get('id')), float(x.get('depart'))))

# Print the sorted vehicles
for vehicle in vehicles:
    vehicle_str = ET.tostring(vehicle, encoding='unicode')
    print(vehicle_str)

# Print the final sorted XML string
final_xml_string = ''.join([ET.tostring(vehicle, encoding='unicode') for vehicle in vehicles])
